import { useEffect, useState } from "react";
import { io } from "socket.io-client";
import axios from "axios";

const socket = io("http://localhost:3001");

const Chat = () => {
  const [messages, setMessages] = useState([]);
  const [username, setUsername] = useState("");
  const [text, setText] = useState("");
  const [user, setUser] = useState(null);
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  useEffect(() => {
    axios.get("http://localhost:3001/messages").then((res) => {
      setMessages(res.data);
    });

    socket.on("newMessage", (msg) => {
      setMessages((prev) => [...prev, msg]);
    });

    return () => socket.off("newMessage");
  }, []);

  const sendMessage = () => {
    if (text.trim() !== "" && user) {
      socket.emit("sendMessage", { username: user.username, text });
      setText("");
    }
  };

  const register = async () => {
    try {
      const res = await axios.post("http://localhost:3001/register", {
        username,
        email,
        password,
      });
      setUser(res.data);
      setUsername("");
      setEmail("");
      setPassword("");
      alert("Registration successful!");
    } catch (error) {
      console.error("Registration error:", error.response?.data || error.message);
    }
  };

  const login = async () => {
    try {
      const res = await axios.post("http://localhost:3001/login", {
        email,
        password,
      });
      setUser(res.data);
      alert("Login successful!");
    } catch (error) {
      console.error("Login error:", error.response?.data || error.message);
    }
  };

  return (
    <div className="chat-container">
      <h2>Чат</h2>

      {user ? (
        <>
          <p>Logged in as: <strong>{user.username}</strong></p>
          <div className="messages">
            {messages.map((msg) => (
              <div key={msg.id} className="message">
                <strong>{msg.username}:</strong> {msg.text}
              </div>
            ))}
          </div>
          <input
            className="input"
            type="text"
            placeholder="Ваше повідомлення..."
            value={text}
            onChange={(e) => setText(e.target.value)}
            onKeyDown={(e) => e.key === "Enter" && sendMessage()}
          />
          <button onClick={sendMessage} className="btn">Send</button>
        </>
      ) : (
        <>
          <h3>Register</h3>
          <input className = "register" type="text" placeholder="Name" value={username} onChange={(e) => setUsername(e.target.value)} />
          <input className = "register" type="email" placeholder="Email" value={email} onChange={(e) => setEmail(e.target.value)} />
          <input className = "register" type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} />
          <button className = "back-button" onClick={register}>Register</button>
          <h3 className="h3">OR</h3>
          <h3>Login</h3>
          <input className = "login" type="email" placeholder="Email" value={email} onChange={(e) => setEmail(e.target.value)} />
          <input className = "login" type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} />
          <button className = "back-button" onClick={login}>Login</button>
        </>
      )}
    </div>
  );
};

export default Chat;
